const API_URL = "http://localhost:5000/api/colleges";

export const getCollegesByRank = async (rank) => {
    try {
        const response = await axios.get(`${API_URL}?rank=${rank}`);
        return response.data; // Ensure data is passed correctly
    } catch (error) {
        console.error("Error fetching colleges:", error);
        throw error;
    }
};
